import styled from 'styled-components';
const Container = styled.div`
  height: 100vh;
  width: 100vw;
`

const Body = styled.div`
  width: 100%
  >button {
    background-color: red;
  }
  `
const ButtonGoogle = styled.button`
  width: 20%;
  padding: 10px 5px 10px 5px;
  background-color: red;
  `

export {
  Container,
  Body,
  ButtonGoogle
}
